English | CBR and CBZ | 22 Issues

Team Youngblood #1-22
Publisher:  Image Comics
Publication Date:  September 1993 - April 1996

The Liberty II satellite has been taking over by Giger and his cybernetic assassins. Now it's up to Sentinel to assemble an elite team of Youngblood members to handle the situation. Riptide, Cougar, Photon, and Masada stand ready. But when Brahma refusing to answer the call to arms Sentinel must ask the one man he never wanted to see again for help. &quot;Blackout.&quot; Story by Rob Liefeld. Art by Chap Yaep and Norm Rapmund.

